import React from 'react';
import { useParams } from 'react-router';

const AccountForm = () => {
    const params = useParams()
    return <>
        <h2>AccountForm</h2>
        <p>{params.method}</p>
        <form>
            <input type="text" placeholder="username"></input>
            <input type="password" placeholder="password"></input>
        </form>
    </>
}

export default AccountForm;
